package by.ninjas.gymuniverse.gymms.persistence.repositories;

import by.ninjas.gymuniverse.gymms.persistence.enums.FileExtension;
import by.ninjas.gymuniverse.gymms.testutils.EmbeddedPostgres;
import by.ninjas.gymuniverse.gymms.testutils.slices.DbTest;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.test.context.jdbc.Sql;

import static org.assertj.core.api.Assertions.assertThat;
import static org.junit.jupiter.api.Assertions.assertAll;
import static org.junit.jupiter.api.Assertions.assertEquals;

/**
 * Tests for {@link ExerciseResourceRepository}.
 *
 * @author dziomin
 * @version 0.2.0
 * @since 0.2.0
 */
@DbTest
@Sql(scripts = "classpath:sql/exercise-resource.sql", executionPhase = Sql.ExecutionPhase.BEFORE_TEST_CLASS)
@Sql(scripts = "classpath:sql/clear-all.sql", executionPhase = Sql.ExecutionPhase.AFTER_TEST_CLASS)
class ExerciseResourceRepositoryTests extends EmbeddedPostgres {

    @Autowired
    ExerciseResourceRepository repository;

    @Test
    void findById() {
        var actual = repository.findById((short) 1).orElseThrow();
        var fileContentExpected = "";

        assertAll(
            () -> assertThat(actual.getContent()).asBase64Encoded().isEqualTo(fileContentExpected),
            () -> assertEquals((short) 1, actual.getId()),
            () -> assertEquals("fileName", actual.getFileName()),
            () -> assertEquals(FileExtension.PNG, actual.getFileExtension()));
    }

}
